def run_command(cmd):
    proc = subprocess.Popen(cmd, shell=True, stdout=subprocess.PIPE,
      stderr=subprocess.PIPE, stdin=subprocess.PIPE)
    stdoutput = proc.stdout.read() + proc.stderr.read()
    return stdoutput

def build_bin(name):
	run_command('fasm %s.asm' % name)

def gen_data_sect(name, enc_num, shift_num, question, correct, incorrect):
	sect = "section '.%s' data readable writeable\n" % name
	lines = ["enc_num dd %u" % enc_num,
	"shift_num db %d" % shift_num,
	"inp_num dd 0",
	"inp_str db '%d', 0",
	"ask_str db '%s', 0" % question,
	"fail_str db '%s', 0" % incorrect,
	"right_str db '%s', ENDL, 0" % correct]
	random.shuffle(lines)
	for x in lines:
		sect += x + '\n'
	return sect

def gen_code_sect(name, other_num, operation):
	sect = 'section \'.%s\' code readable executable\n' % name
	ops = ['mod_sub', 'mod_add', 'mod_xor']
	funcs = ['mod_xor:\n\txor eax, ecx\n\tret\n',
	'mod_sub:\n\tsub eax, ecx\n\tret\n',
	'mod_add:\n\tadd eax, ecx\n\tret\n',
	'''start:
	push ask_str
	call [puts]
	pop eax
	push inp_num
	push inp_str
	call [scanf]
	add esp, 8
	mov eax, [enc_num]
	mov ecx, %u
	call %s
	cmp eax, [inp_num]
	jnz .fail
	mov cl, [shift_num]
	sar eax, cl
	and eax, 0xff
	push eax
	push right_str
	call [printf]
	add esp, 8
	jmp .finish
.fail:
	push fail_str
	call [puts]
	pop eax

.finish:
	ret\n''' % (other_num, ops[operation])]
	random.shuffle(funcs)
	for x in funcs:
		sect += x
	return sect

def gen_import_sect(name):
	sect = '''section '.%s' data readable

data import
    library msvcrt, 'msvcrt.dll'
    import msvcrt,\\
''' % name
	imports = ["printf ,'printf'", "scanf , 'scanf'", "puts , 'puts'"]
	random.shuffle(imports)
	for x in range(0, len(imports)):
		sect += '\t\t' + imports[x]
		if x != len(imports) - 1:
			sect += ', \\'
		sect += '\n'
	sect += 'end data\n'
	return sect

def gen_asm(file_name, dat_name, code_name, import_name, char):
	shift_num = random.randint(0,24)
	enc_num = ((ord(char) << shift_num) | (~(0xff << shift_num) & random.randint(0, 0xffffffff)))
	operation = random.randint(0,2)
	other_num = random.randint(0, 0xffffffff)

	print('%s.exe : %d' % (file_name, enc_num))

	if operation == 0:
		enc_num += other_num
	elif operation == 1:
		enc_num -= other_num
	elif operation == 2:
		enc_num ^= other_num

	enc_num &= 0xffffffff

	question = random.choice(['#?', 'Enter a number:', 'Launch codes?', 'What is my favorite number?', 'How old are you?'])
	correct = random.choice(['Correct, its (%c)!', 'Wow you got it. Here is the result: (%c)', 'A: (%c)', '(%c), duh.'])
	incorrect = random.choice(['Are you just guessing?', 'Incorrect!', 'I think my dog figured this out before you.', 'You have the iq of a brick.'])

	data_sect = gen_data_sect(dat_name, enc_num, shift_num, question, correct, incorrect)
	code_sect = gen_code_sect(code_name, other_num, operation)
	imp_sect = gen_import_sect(import_name)

	file_dat = '''format PE console
entry start
include 'C:\\Projects/asm/INCLUDE/win32a.inc'
include 'C:\\Projects/asm/std.inc'
'''
	sects = [data_sect, code_sect, imp_sect]
	random.shuffle(sects)
	for x in sects:
		file_dat += x
	f = open('%s.asm' % file_name, 'w')
	f.write(file_dat)
	f.close()
	return

def random_section_name(length):
	sect_name = ''
	for x in range(0,length):
		sect_name += random.choice(list('abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ0123456789'))
	return sect_name

